import React, { useEffect, useState } from 'react'
import './testform.css'
import bank from '../Assets/pngwing.com.png'
import SideBar from '../SideBar/SideBar'
import { useNavigate } from "react-router-dom";
import axios from 'axios';

function TestForm() {
    const navigate = useNavigate();
    const [form,formData] = useState({
        accoutid : '',
        balance : 0
    })

    useEffect(()=>{
        const token = localStorage.getItem("token")
        axios.get('http://localhost:8000/account_details', {
            headers:{
                Authorization:`Bearer ${token}`
            }
        }).then((response)=>{
            console.log(response.data,"dataaaaaaaaa");

        })
    },[])


  return (
    <div className=''>
        <SideBar/>
        <div className='accnt-container'>
            <div className="left-container">
                <img className='bank-icon' src={bank}></img>
            </div>
            <div className="right-container">
                <h1 style={{textAlign:'center',paddingTop:'50px', fontFamily:'cursive'}}>Account Details</h1>
                <div style={{display:'flex',justifyContent:'center'}}>
                <div className='accnt_underline'></div>
                </div>
                <div style={{display:'flex',justifyContent:'center'}}>
                <div className="accn-container">
                    {/* <div className="acc_input"> */}
                        {/* <label className='acc_label' htmlFor="">Accounts ID</label>
                        <input className='input_label' type='text' name='accountid' ></input> */}
                        <p>AccoutID: {form.accoutid}</p>
                    {/* </div> */}
                    {/* <div className="acc_input"> */}
                        {/* <label className='acc_label' htmlFor="">Balance</label>
                        <input className='input_label' type='text' name='balance' ></input> */}
                        <p>Balance: {form.balance}</p>
                    <div className="btn">
                        <button type="button" onClick={()=>navigate('/deposite')} className='deposite-btn'>Deposit</button>
                        <button type='button' onClick={()=>navigate('/withdraw')} className='deposite-btn'>Withdraw</button>
                    </div>
                </div>
                </div>
            </div>
        </div>
    </div>
  )
}

export default TestForm
